- input: "TEXT\x1CC00001388\x1CSA16.24856.TEXT\x1CSA16.24856\x1CSA16\x1COn February
    11, 2008 DEPAC issued a check to Mike Simpson for Congress (R-2nd/ID).  The check
    was sent to Congressman Simpson's fundraiser.  The fundraiser also does work for
    Congressman Frank Lucas (R-3rd/OK).  DEPAC's check was forwarded to the Lucas
    campaign in error and was deposited into Congressman Lucas' bank account.  Neither
    the Lucas campaign nor the bank caught the error.  We were notified of the error
    by the fundraiser after the check had cleared the Lucas account.  After speaking
    with Rosa at the FEC - she indicated the refund should come from the Lucas campaign
    and DEPAC will in turn re-issue a check to Mike Simpson.  She also indicated to
    show the refund coming from the Simpson campaign.  Note that DEPAC did report
    the contribution that was intended for Congressman Simpson correctly on its February
    report."
